create view [dbo].[View_VerUsuarios]
as
SELECT [IdUsuario]
      ,[Identificacion]
      ,[NombreCompleto]
      ,USU.[IdRol]
	  ,ROL.Nombre NombreRol
      ,[Correo]
      ,[Contrasenna]
      ,[Telefono]
      ,[ClaveTemporal]
      ,[FechaCreacionUsuario]
      ,[FechaCaducidad]
      ,USU.[Estado]
  FROM [BD_Proyecto_Gym].[dbo].[Usuarios] USU
  inner join [BD_Proyecto_Gym].[dbo].[Roles] ROL ON USU.[IdRol] = ROL.[IdRol]
  --order by USU.[IdUsuario] desc
