INSERT [dbo].[Ejercicios] ([IdEjercicio], [NombreEjercicio], [DescripcionEjercicio], [VideoEjercicio]) VALUES (4, N'Press Banca', N'
El press de banca es un ejercicio clásico de levantamiento de pesas que se realiza acostado en un banco horizontal. Consiste en levantar una barra cargada con pesas desde el pecho hasta los brazos extendidos, utilizando principalmente los músculos pectorales, deltoides anteriores y tríceps. Se enfoca en el desarrollo de fuerza y ??volumen en el área del pecho y los brazos. Es crucial mantener una técnica adecuada para evitar lesiones y maximizar los beneficios del ejercicio.', N'https://www.youtube.com/watch?v=QfzVuiWRKSA&ab_channel=WeFitPlace')
GO
INSERT [dbo].[Ejercicios] ([IdEjercicio], [NombreEjercicio], [DescripcionEjercicio], [VideoEjercicio]) VALUES (5, N'Press militar', N'El ejercicio de press militar es un movimiento de levantamiento de pesas que se realiza de pie o sentado, donde se elevan las pesas desde los hombros hasta los brazos estirados por encima de la cabeza. Trabaja principalmente los músculos deltoides (hombros) y también involucra los tríceps y músculos estabilizadores del core. Es una excelente forma de fortalecer y desarrollar la fuerza en la parte superior del cuerpo.', N'https://www.youtube.com/watch?v=CjE9a_hSwMk&ab_channel=Cruzzfit')
GO
INSERT [dbo].[Ejercicios] ([IdEjercicio], [NombreEjercicio], [DescripcionEjercicio], [VideoEjercicio]) VALUES (6, N'Curl Biceps', N' El curl de bíceps es un ejercicio para fortalecer los músculos del bíceps braquial, ubicados en la parte frontal de los brazos. Se realiza típicamente con mancuernas o una barra, donde se flexionan los codos levantando el peso desde una posición extendida hasta aproximadamente la altura de los hombros, manteniendo los codos cerca del cuerpo. Este ejercicio se centra en aislar y trabajar los músculos del bíceps, ayudando a desarrollar fuerza y tamaño en esa área específica del brazo.', N'https://www.youtube.com/watch?v=4lbIb30SB2U&ab_channel=WeFitPlace')
GO
INSERT [dbo].[Ejercicios] ([IdEjercicio], [NombreEjercicio], [DescripcionEjercicio], [VideoEjercicio]) VALUES (7, N'Sentadilla Goblet', N'
La sentadilla goblet implica sostener una pesa cerca del pecho y agacharse manteniendo los pies separados al ancho de los hombros. Flexionas rodillas y caderas, manteniendo la espalda recta, hasta que los muslos estén paralelos al suelo o más abajo, luego vuelves a la posición inicial. Fortalece piernas, glúteos y core, mejorando estabilidad y fuerza.', N'https://www.youtube.com/watch?v=H2Zzn5YJvOk&ab_channel=FunctionalBodybuilding')
