CREATE PROCEDURE [dbo].[ActualizarClaveTemporal]
	@IdUsuario				bigint,
	@contrasennaTemporal	varchar(4)
AS
BEGIN

	UPDATE dbo.Usuarios
	SET Contrasenna = @contrasennaTemporal,
		ClaveTemporal = 1,
		
        FechaCaducidad = DATEADD(mi,30,GETDATE())
	WHERE IdUsuario = @IdUsuario

END
