/****** Object:  StoredProcedure [dbo].[sp_ObtenerSubscripcion]    Script Date: 14 dic. 2023 14:59:17 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
	CREATE PROCEDURE [dbo].[sp_ObtenerSubscripcion]
		@idUsuario int
	AS
	BEGIN
		SELECT ins.IdUsuario, ins.IdPaquete, ins.FechaCaducidadInscripcion, pq.Nombre
			FROM Inscripciones ins
			LEFT JOIN Paquetes pq ON pq.IdPaquete = ins.IdPaquete
			WHERE ins.IdUsuario = @idUsuario
			AND CAST(FechaCaducidadInscripcion AS DATE) >= CAST(GETDATE() AS DATE)
	END
GO
/****** Object:  StoredProcedure [dbo].[sp_procesar_subscripcion]    Script Date: 14 dic. 2023 14:59:17 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
	CREATE PROCEDURE [dbo].[sp_procesar_subscripcion]
		@IdUsuario int,
		@IdPaquete int,
		@DescripcionPago NVARCHAR,
		@MontoPago decimal
	AS
		DECLARE @idPago int
	BEGIN
		--Inserto el pago realizado en por stripe para manejar el historico.
		INSERT INTO Pagos(IdUsuario, IdPaquete, Descripcion, MontoPago, FechaCreacionPago)
		VALUES(@IdUsuario, @IdPaquete, @DescripcionPago, @MontoPago, GETDATE())
		
		--Obtengo el ID del pago realizado
		SET @idPago = (SELECT TOP 1 idPago FROM Pagos WHERE IdUsuario = @IdUsuario ORDER BY FechaCreacionPago desc )
		
		--Genero la susbcripcion asociada al pago recibido
		INSERT INTO Inscripciones(IdUsuario, IdPaquete, IdPago, FechaCreacionInscripcion, FechaCaducidadInscripcion)
		VALUES (@IdUsuario, @IdPaquete, @idPago, GETDATE(), DATEADD(MONTH, 1, GETDATE()))
	END
GO
